import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
const AppContext = React.createContext('light');
ReactDOM.render(
  <React.StrictMode>
      <AppContext.Provider value="dark">
          <App />
      </AppContext.Provider>
  </React.StrictMode>, document.getElementById('root')
);
